import React, { Component } from 'react';
// import { Link } from 'react-router-dom';
import { Container, Row } from 'react-bootstrap';
import './main.css';
import './recipes.css';

import Recipe from './Recipe';

import { SMORE, OREO, POLLO } from '../strings'

export default class Recipes extends Component {
    render() {
        document.title = 'Recipes'

        return (
            <Container className='nav-offset center-column'>
                <Row>
                    <p className='section-header'>the classics</p>
                </Row>
                <Row>
                    <Recipe info={ SMORE }></Recipe>
                    <Recipe info={ POLLO }></Recipe>
                </Row>
                <Row>
                    <p className='section-header'>our favorites</p>
                </Row>
                <Row>
                    <Recipe info={ OREO }></Recipe>
                </Row>
            </Container>
        )
    }
}
